import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";



function App() {
    return (
      <div>
        {/* <Header /> */}
        {notes.map((listNodes)=>
            (
              <Note 
                key = {listNodes.key}
                title = {listNodes.title}
                para = {listNodes.content}
              />
            )
          )}
        <Footer />
      </div>
    );
}


export default App;
